class BookComponent {
    constructor(router, route, http) {
        this.router = router;
        this.route = route;
        this.http = http;
        // constructor(private http: HttpClient) { }
        this.book = {}; // added router for delete fuction
    }
    ngOnInit() {
        this.router.onSameUrlNavigation = "reload";
        //  this.http.get('http://localhost:3000/books').subscribe(data => {
        this.http.get('/book').subscribe(data => {
            this.books = data;
        });
    }
    onSubmit(isbn) {
        this.router.navigateByUrl('/book-search/' + isbn);
    }
    deleteBook(id) {
        this.http.delete('/book/' + id)
            .subscribe(res => {
            this.ngOnInit();
            // this.router.navigate(['/books']); //need to reload
        }, (err) => {
            console.log(err);
        });
    }
    saveBook() {
        //
        this.http.post('/book', this.book)
            .subscribe(res => {
            let id = res['_id'];
            // this.router.navigate(['/books']);
            this.ngOnInit();
            // this.router.navigateByUrl("/")
        }, (err) => {
            console.log(err);
        });
    }
}
